        let thisValue = e.target.value
        setAnswerObj({thisName: thisValue})
    }
    console.log(answerObj)
    return (
        <div>
            {qs.map(q => 
                <div><form>{q.text}
                {q.options.map(o => 
                    <label>{o.text}
